class CaculateBtn extends Component {
  constructor(props) {
    super(props)
    this.state = {}

  }



  render() {
    return (
      <div className="caculateBtnStyle">
        {caculatorBtnTextArray.map((value,index) => { 
          return (
          <div key={index}>value</div>
          )
        })} 
      </div>
    )
  }

}

export default CaculateBtn;
